const ancho = myChart.getWidth();
const alto = myChart.getHeight();

const uniqueVoltages = Array.from(new Set(Object.values(networkData.bus).map(b => Math.round(b.base_kv*100)/100)));
const categories = [
  { name: "Menor a 69 kV" },
  ...uniqueVoltages
    .filter(kv => kv >= 50)
    .map(kv => ({ name: kv + " kV" }))
];

const validBusIds = new Set(Object.keys(networkData.bus));

const data = Object.entries(networkData.bus).map(([id, bus]) => {
  const kvRounded = Math.round(bus.base_kv*100)/100;
  const nodo = {
    id: id,
    symbolSize: 16,
    name: bus.name,
    value: bus.source_id[2],
    category: kvRounded < 50
      ? 0
      : uniqueVoltages
          .filter(kv => kv >= 50)
          .indexOf(kvRounded) + 1 // +1 porque el índice 0 ya lo ocupa "Menor a 50 kV"
  };

  if (id === "741") {
    nodo.x = ancho / 2;
    nodo.y = alto / 2;
    nodo.fixed = true;
    nodo.symbolSize = 26;
  }

  return nodo;
});

const edgeMap = new Map();

const edgesRaw = Object.values(networkData.branch).filter(
  branch => validBusIds.has(branch.f_bus) && validBusIds.has(branch.t_bus)
);

for (const branch of edgesRaw) {
  const key = `${branch.f_bus}-${branch.t_bus}`;
  const reverseKey = `${branch.t_bus}-${branch.f_bus}`;
  const baseKey = edgeMap.has(key) ? key : (edgeMap.has(reverseKey) ? reverseKey : key);

  if (!edgeMap.has(baseKey)) edgeMap.set(baseKey, []);
  edgeMap.get(baseKey).push(branch);
}

const edges = [];

edgeMap.forEach((branches, key) => {
  const [source, target] = key.split("-");
  const count = branches.length;
  const offsetStep = 0.15;

  branches.forEach((branch, index) => {
    const offset = (index - (count - 1) / 2) * offsetStep;

    edges.push({
      source: branch.f_bus,
      target: branch.t_bus,
      symbol: branch.transformer ? ['none', 'none'] : ['none', 'none'],
      symbolSize: branch.transformer ? 6 : 0,
      lineStyle: {
        curveness: offset,
        color: branch.transformer ? '#111' : '#999',
        type: branch.transformer ? 'dotted' : 'solid',
        width: 2
      }
    });
  });
});

if (networkData.switch) {
  const switches = Object.values(networkData.switch)
    .filter(sw => validBusIds.has(sw.f_bus) && validBusIds.has(sw.t_bus))
    .map(sw => ({
      source: sw.f_bus,
      target: sw.t_bus,
      symbol: ['circle', 'circle'],
      symbolSize: 4,
      lineStyle: {
        color: '#00cc66',
        type: 'dotted',
        width: 2
      }
    }));

  edges.push(...switches);
}

      label: { show: false },
      force: {
        repulsion: 50000000,
        edgeLength: 10
      },
      data: data,
      edges: edges
    }
